  const handleGoNext = () => {
    setScreen(true);
  };

  return (
    <>
      {isNext ? (
        <ComputerScreen />
      ) : (
        <BugFound onClickAnywhere={handleGoNext} />
      )}
    </>
  );
}

export default App;
